import React from "react";
// import { useAuth0 } from "@auth0/auth0-react";
import AdvocateLoginButton from "./AdvocateLoginButton";
import A2JLoginButton from "./A2JLoginButton";

const loginStyle = {
  position: "relative",
  width: "23vw",
  height: "10vh",
  fontSize: "2vh",
  border: "none",
  borderBottom: "2px solid #00282a",
  backgroundColor: "transparent",
};

const AuthNav = () => {
  // const { isAuthicated } = useAuth0();

  return (
    <div className="justify-content-end">
      <AdvocateLoginButton />
      <A2JLoginButton />
    </div>
  );
};

const LoginForm = () => {
  return (
    <div>
      <form className="ui form" style={{ top: "28vh", left: "5vw" }}>
        <div className="field">
          <input
            type="email"
            name="email"
            placeholder="Email"
            style={loginStyle}
          ></input>
        </div>
        <div className="field">
          <input
            type="password"
            name="password"
            placeholder="Password"
            style={loginStyle}
          ></input>
        </div>
        <AuthNav />
      </form>
    </div>
  );
};

export default LoginForm;
